from sympy.ntheory.factor_ import udivisor_sigma
from sympy import mobius, integer_nthroot
def A366537(n):
    def f(x): return n+x-sum(mobius(k)*(x//k**3) for k in range(1, integer_nthroot(x,3)[0]+1))
